create table restaurants (
	restaurant_id INT,
	restaurant_name VARCHAR(150),
	phone_number VARCHAR(50),
	email VARCHAR(256),
	address VARCHAR(150),
	city VARCHAR(75),
	state VARCHAR(75),
	zip_code VARCHAR(5),
	rating INT,
	slogan VARCHAR(150),
	description TEXT,
	image VARCHAR(256),
	open VARCHAR(50),
	close VARCHAR(50),
	category INT,
	type_of_food INT
);
